//funções que executam as rotas das páginas 

export const goToHome = (history) => {
    history.push ("/")
}

export const goToMovie = (history) => {
    history.push ("/movie")
}

export const goToSignup = (history) => {
    history.push ("/signup")
}

export const goToLogin = (history) => {
    history.push ("/login")
}
